INSERT INTO `catalog_product_entity_text` VALUES (31,75,0,29,'<style>#html-body [data-pb-style=AAS26IC]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"AAS26IC\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><h2 id=\"ftoc-heading-8\" class=\"ftwp-heading ftwp-heading-target\">Thm Lt Sn  T Kardo Vinfast VF9</h2>\r\n<h3 id=\"ftoc-heading-9\" class=\"ftwp-heading\">1. Bo V Sn Xe Khi Bi Bn</h3>\r\n<div>Li ch chnh ca thm lt sn  t Kardo Vinfast VF9 l bo v sn xe khi bi bn v cc tc nhn gy hi khc n phn n trn sn. D xe ca bn c s dng hng ngy hay ch trong nhng chuyn i di ngy, thm lt sn lun gi cho sn xe ca bn sch s v mi m. Vic ny khng ch bo v gi tr ca xe m cn gip bn tit kim chi ph bo tr v sa cha sau ny.</div>\r\n<h3 id=\"ftoc-heading-10\" class=\"ftwp-heading\">2. D Dng V Sinh</h3>\r\n<div>Thm lt sn  t Kardo Vinfast VF9 c thit k c bit d dng lm sch. Bn c th d dng lau chi hoc ra sch bng nc. Bn c th b thm ra khi xe rt d dng v sinh bng nc v sau  lp t li ch trong 2 pht. Kh nng v sinh d dng gip tit kim thi gian v cng sc trong vic duy tr s sch s cho ni tht xe ca bn.</div>\r\n<h3 id=\"ftoc-heading-11\" class=\"ftwp-heading\">3. Tng Cng An Ton</h3>\r\n<div>Thm lt sn  t Kardo Vinfast VF9 c thit k vi tnh nng chng trt, gip tng cng an ton khi li xe. Thm lt sn c b mt chng trt gip gi cho chn bn n nh trn bn p Ga  Phanh, gim nguy c trt chn v cc s c khng mong mun trong qu trnh li xe. y l mt yu t quan trng, c bit khi bn li xe trn cc iu kin ng trn trt v gp gnh.</div>\r\n<h3 id=\"ftoc-heading-12\" class=\"ftwp-heading\">4. To Khng Gian Ni Tht Thoi Mi</h3>\r\n<div>Thm lt sn  t Kardo Vinfast VF9 khng ch c chc nng bo v m cn gip khng gian ni tht thoi mi sang trng v phong cch. Vi thit c theo chun tng i Xe to cm gic mi chi tit sn xe tr nn ng nht v tng gi tr ca xe. iu ny gip ch xe tng s hi lng khi s dng v to nn khng gian sang trng, thoi mi khi ngi.</div></div></div></div>'),(32,85,0,29,'Thm Lt Sn  T Kardo Vinfast VF9'),(33,75,0,30,'<style>#html-body [data-pb-style=EHI82J7]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"EHI82J7\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><h2 id=\"ftoc-heading-8\" class=\"ftwp-heading ftwp-heading-target\">Li ch ca Thm Lt Sn  T Kardo Toyota Veloz 2022  Nay</h2>\r\n<h3 id=\"ftoc-heading-9\" class=\"ftwp-heading\">1. Bo V Sn Xe Khi Bi Bn</h3>\r\n<div>Li ch chnh ca thm lt sn  t Kardo Toyota Veloz 2022  Nay l bo v sn xe khi bi bn v cc tc nhn gy hi khc n phn n trn sn. D xe ca bn c s dng hng ngy hay ch trong nhng chuyn i di ngy, thm lt sn lun gi cho sn xe ca bn sch s v mi m. Vic ny khng ch bo v gi tr ca xe m cn gip bn tit kim chi ph bo tr v sa cha sau ny.</div>\r\n<h3 id=\"ftoc-heading-10\" class=\"ftwp-heading\">2. D Dng V Sinh</h3>\r\n<div>Thm lt sn  t Kardo Toyota Veloz 2022  Nay c thit k c bit d dng lm sch. Bn c th d dng lau chi hoc ra sch bng nc. Bn c th b thm ra khi xe rt d dng v sinh bng nc v sau  lp t li ch trong 2 pht. Kh nng v sinh d dng gip tit kim thi gian v cng sc trong vic duy tr s s