>Khch hng c tip nhn sn phm theo quy trnh: nhn hng  kim tra  thanh ton. Nu qu khch khng hi lng v sn phm c th t chi nhn hng.</li>\r\n<li>Cavaha Auto cung cp chnh sch 1 i 1 trong vng 30 ngy v cam kt bo hnh trong vng 12 thng i vi tt c sn phm ti ca hng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-8597\" src=\"https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-1024x1024.jpg 1024w, https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-1536x1536.jpg 1536w, https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-2048x2048.jpg 2048w, https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2021/08/boc-vo-lang-sparco-min-100x100.jpg 100w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n</div></div></div></div>'),(123,85,0,74,'Bc V Lng Sparco Chnh Hng - 116 BK'),(124,75,0,75,'<style>#html-body [data-pb-style=WSF2YW4]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"WSF2YW4\"><div data-content-type=\"text\" data-appearance=\"default\"