 an\" width=\"600\" height=\"401\"><img class=\"aligncenter wp-image-11856\" src=\"https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-6.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-6.jpg 662w, https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-6-300x201.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-6-600x402.jpg 600w\" alt=\"Dy treo trang tr xe  t phong thy, s giu c v bnh an\" width=\"600\" height=\"402\" loading=\"lazy\"><img class=\"aligncenter wp-image-11857\" src=\"https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-7.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-7.jpg 668w, https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-7-300x199.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-7-600x399.jpg 600w\" alt=\"Dy treo trang tr xe  t phong thy, s giu c v bnh an\" width=\"600\" height=\"399\" loading=\"lazy\"><img class=\"aligncenter wp-image-11858\" src=\"https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-2.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-2.jpg 672w, https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-2-225x300.jpg 225w, https://www.cavaha.com/wp-content/uploads/2023/12/day-treo-trang-tri-o-to-phong-thuy-mau-3-2-600x800.jpg 600w\" alt=\"Dy treo trang tr xe  t phong thy, s giu c v bnh an\" width=\"600\" height=\"800\" loading=\"lazy\"></p></div></div></div>'),(170,85,0,98,'Dy treo trang tr xe  t phong thy, s giu c v bnh an'),(171,75,0,99,'<style>#html-body [data-pb-style=LLUSE88]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"LLUSE88\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><h2>Camera hnh trnh 70Mai M300</h2>\r\n<p>Phin bn nng cp mi nht da trn mu 70mai Minutes. Vi c kch thc nh gn, cht lng hnh nh  phn gii cao 2K cho php ghi li hnh nh r nt c ban ngy v ban m. M300 c trang b gc nhn 140  m bo gip bn quan st tt cc tnh hung  2 bn ng. iu ny lm cho chic camera 70mai M300 l b ph kin khng th thiu cho chic xe hi ca bn.</p>\r\n<p><img class=\"aligncenter wp-image-9218\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-srbo6smf5cjv2a-300x146.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-srbo6smf5cjv2a-300x146.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-srbo6smf5cjv2a-600x292.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-srbo6smf5cjv2a.jpeg 731w\" alt=\"\" width=\"600\" height=\"292\"></p>\r\n<h3><strong>Thng tin sn phm camera hnh trnh  t 70Mai M300 cao cp</strong></h3>\r\n<ul>\r\n<li class=\"irIKAp\">Tn sn phm: Camera hnh trnh 70mai M300</li>\r\n<li class=\"irIKAp\">Thng hiu: 70MAI</li>\r\n<li class=\"irIKAp\">Model: M300</li>\r\n<li class=\"irIKAp\">Dy chuyn cng ngh hin i Xiaomi</li>\r\n<li class=\"irIKAp\">Nh sn xut: 70mai Co., Ltd</li>\r\n<li class=\"irIKAp\">Nh NK &amp; PP: Cng ty C phn Cng Ngh Auto Chu </li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9221\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300.jpg 800w\" alt=\"\" width=\"600\" height=\"600\"></p>\r\n<h3><strong>Thng s k thut sn phm Camera hnh trnh  t 70Mai M300</strong></h3>\r\n<ul>\r\n<li>Dung lng pin: 240mAh.</li>\r\n<li>Kt ni: Wifi 2.4G.</li>\r\n<li> phn gii: 2304 x 1296 PX.</li>\r\n<li>Gc nhn m rng: 140.</li>\r\n<li>Ch  kh nhiu: C.</li>\r\n<li>Ch  Time Lapse: C.</li>\r\n<li>Kt ni ti app: C.</li>\r\n<li>Khe cm th nh h tr dung lng ti a 128GB</li>\r\n<li>Cht liu sn phm: V bng hp kim sang trng.</li>\r\n<li>Tng thch: Ph hp vi tt c cc dng xe  t hin nay.</li>\r\n<li>Ph kin: Cable MicroUSB di 3.5m,  gn camera, Tu sc USB 5V 2A.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9227\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-7-300x188.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-7-300x188.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-7-768x480.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-7-600x375.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-7.jpg 800w\" alt=\"\" width=\"600\" height=\"375\"></p>\r\n<h3><strong>u im ca sn phm Camera hnh trnh  t 70Mai M300 cao cp</strong></h3>\r\n<ul>\r\n<li><strong>Camera hnh trnh  t 70mai M300&nbsp;</strong>c thit k vi gc nhn rng ln ti 140 , m bo m rng tm quan st  bn t tin lm ch nhng chuyn i. Bn cnh , khu  ln ca&nbsp;<strong>Camera 70mai M300&nbsp;</strong>l F2.1 cn h tr cho hnh nh r nt c vo ban m.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9226\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-6-300x225.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-6-300x225.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-6-768x576.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-6-600x450.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-6.jpg 800w\" alt=\"\" width=\"600\" height=\"450\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Bn hon ton yn tm vi tm nhn ny kh nng phn tch nh gi ln ng, vt cn lun m bo an ton cho hnh trnh ca bn. Hnh nh v video c ghi li c chi tit v bao qut nht.</li>\r\n<li>c trang b camera 3 megapixel, Camera hnh trnh Xiaomi 70mai M300 ghi hnh cht lng 2304 x 1296P, to ra hnh nh c cht lng sc nt hn nhiu ln so vi phin bn 70mai 1s v 70mai Dash cam Lite.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9224\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-4-300x225.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-4-300x225.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-4-768x576.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-4-600x450.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/camera-70mai-A300-4.jpg 800w\" alt=\"\" width=\"600\" height=\"450\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Camera hnh trnh xe hi 70mai M300 c thit k vi mu sc sang trng, d phi vi ni tht  t. Phong cch thit k hnh tr trn nh gn gip bn d dng t camera sau gng chiu hu m khng lo khut tm nhn.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9229\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/2f6e46694c5743a9d87e8c9df3214c47-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/2f6e46694c5743a9d87e8c9df3214c47-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/2f6e46694c5743a9d87e8c9df3214c47-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/2f6e46694c5743a9d87e8c9df3214c47-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/2f6e46694c5743a9d87e8c9df3214c47-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/2f6e46694c5743a9d87e8c9df3214c47-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/2f6e46694c5743a9d87e8c9df3214c47.jpeg 1024w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Ngoi ra Camera hnh trnh 70mai M300 cn c mt tnh nng rt hu ch l h tr  xe an ton thng qua b Hardware Kit, y l mt tnh nng trc y 70mai ch trang b trn cc mu sn phm cao cp. Hin nay cc mu 1S hay 70mai Lite khng c trang b tnh nng ny.</li>\r\n<li>Vi tnh nng gim st u xe 24h (Parking Surveillance), ngi dng s yn tm hn mi khi phi u xe  ni vng v, khng c ngi trng xe. Nu c va chm t ngt no, Camera s t ng khi chy v thc hin ghi hnh  nm bt s c.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9219\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-y1ueqvyh5cjv20-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-y1ueqvyh5cjv20-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-y1ueqvyh5cjv20-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-y1ueqvyh5cjv20-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-y1ueqvyh5cjv20-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-y1ueqvyh5cjv20-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-y1ueqvyh5cjv20.jpeg 1000w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Vi cng ngh gim nhiu 3D DNR v WDR, M300 loi b hnh nh cht lng thp v cn bng  phi sng, to hnh nh r nt khi ghi hnh vo bui chiu ti, ban m, khu vc thiu nh sng.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3><strong>Cng dng ca Camera hnh trnh  t 70Mai M300</strong></h3>\r\n<ul>\r\n<li><strong>Camera 70Mai M300&nbsp;</strong>s gip bn quay li qu trnh li xe ca mnh.  c th l nhng khonh khc ng nh, hoc nhng s c cn thit phi ghi hnh li lm bng chng.</li>\r\n<li>. Vi ng dng 70mai trn in thoi (Android hoc iOS, kt ni camera qua Wifi), ngi dng c th xem v ti trc tip Video hoc thit lp cc tnh nng cho Camera. c bit cc video quan trng khi xe xy ra va chm hay rung lc mnh s khng b ghi , bn s khng cn bn tm nhiu trong qu trnh li xe.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9230\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/6a02a1c4eb981aa63fb5693a4d5fcda1-1-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/6a02a1c4eb981aa63fb5693a4d5fcda1-1-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/6a02a1c4eb981aa63fb5693a4d5fcda1-1-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/6a02a1c4eb981aa63fb5693a4d5fcda1-1-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/6a02a1c4eb981aa63fb5693a4d5fcda1-1-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/6a02a1c4eb981aa63fb5693a4d5fcda1-1-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/6a02a1c4eb981aa63fb5693a4d5fcda1-1.jpeg 1024w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>D liu hnh nh ca&nbsp;<strong>Camera hnh trnh xe hi 70mai M300</strong>&nbsp;c lu tr trn th nh (ti a 64GB). Khi th nh y, camera thng minh s t ng ghi . Khng cn phi lo lng tho th nh ra  xa nh nhng camera thng thng na. m bo c nhng hnh nh video s c lu tr an ton.</li>\r\n<li>H thng quay time lapse gip bn quay lin tc  tc  1 khung hnh / giy trong ch   xe. Nn mi video c  di 30 pht thnh 1 pht  tit kim dung lng th nh. ng thi cho php pht li nhanh hn nhiu  bn c th nm bt cc s kin ng ch  ngay lp tc.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9232\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/9a3311719c27b11401a82c4581ba1a5f-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/9a3311719c27b11401a82c4581ba1a5f-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/9a3311719c27b11401a82c4581ba1a5f-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/9a3311719c27b11401a82c4581ba1a5f-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/9a3311719c27b11401a82c4581ba1a5f-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/9a3311719c27b11401a82c4581ba1a5f-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/9a3311719c27b11401a82c4581ba1a5f.jpeg 1024w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h3><strong>Hng dn lp t camera hnh trnh  t 70Mai M300</strong></h3>\r\n<ul>\r\n<li>Bc 1: Chn v tr lp t camera trc v sau.</li>\r\n<li>Bc 2: Tin hnh lp t i dy trn xe  t.</li>\r\n<li>Bc 3: Sau khi i dy xong tin hnh cp ngun in.</li>\r\n<li>Bc 4: Test v iu khin sao cho ph hp vi xe.</li>\r\n</ul></div></div></div>'),(172,85,0,99,'Camera Hnh Trnh  T Xiaomi 70mai M300'),(173,75,0,100,'<style>#html-body [data-pb-style=EYS8QR2]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"EYS8QR2\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p><strong>Camera Hnh Trnh  T 70Mai M500</strong>&nbsp;l mt trong nhng dng sn phm cng ngh cao cp n t thng hiu Xiaomi. Vi nhng u im ni bt nh hnh nh sc nt, gc nhn cc rng ln n 170, hay gim st bi u xe 24 gi, sn phm chc chn s l mn ph kin v cng hu ch cho cc bc ti trong thi i s.</p>\r\n<p><img class=\"aligncenter wp-image-9188\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/1-14-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/1-14-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/1-14-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/1-14-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/1-14-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/1-14-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/1-14.jpg 800w\" alt=\"camera hnh trnh  t\" width=\"600\" height=\"600\"></p>\r\n<h3><strong>Thng tin sn phm camera hnh trnh  t 70Mai M500</strong></h3>\r\n<ul>\r\n<li>Tn sn phm: Camera hnh trnh 70Mai M500.</li>\r\n<li>Model sn phm: M500.</li>\r\n<li>Thng hiu: 70Mai Xiaomi.</li>\r\n<li>Trng lng: 0.38 kg.</li>\r\n<li>Tng thch: Ph hp cho tt c cc loi xe  t.</li>\r\n<li>Cht liu: Thp hp kim sang trng bn b.</li>\r\n<li>C nhiu bn theo tng b nh ca sn phm.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9189\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/2-14-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/2-14-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/2-14-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/2-14-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/2-14-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/2-14-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/2-14.jpg 800w\" alt=\"camera hnh trnh  t\" width=\"600\" height=\"600\"></p>\r\n<h3><strong>Thng s k thut camera hnh trnh  t 70Mai M500</strong></h3>\r\n<ul>\r\n<li>Thng hiu: Xiaomi</li>\r\n<li>Model: M500</li>\r\n<li>Gc quay: 170</li>\r\n<li>Khu : F2.0</li>\r\n<li> phn gii: 2592 x 1944P</li>\r\n<li>Kt ni: Wifi 802.11b/g/n</li>\r\n<li>Tch hp b nh: 32GB  128GB</li>\r\n<li>ng dng: Android 4.4 v iOS 10 tr ln</li>\r\n<li>Dung lng pin: 500mAh</li>\r\n<li>Ngun: 5V/2A</li>\r\n<li>Phin bn: quc t</li>\r\n<li>B sn phm gm: 1 camera, 1 dy ngun, 1 tu sc, 1 phm dn, 1 b hng dn s dng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9190\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/5-11-300x188.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/5-11-300x188.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/5-11-768x480.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/5-11-600x375.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/5-11.jpg 800w\" alt=\"camera hnh trnh  t\" width=\"600\" height=\"375\"></p>\r\n<h3>u im ni bt ca sn phm&nbsp;<strong>Camera Hnh Trnh  T 70Mai M500</strong></h3>\r\n<p><img class=\"aligncenter wp-image-9179\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/402a0066e0c182f89e9c69d606df6cb0-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/402a0066e0c182f89e9c69d606df6cb0-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/402a0066e0c182f89e9c69d606df6cb0-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/402a0066e0c182f89e9c69d606df6cb0-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/402a0066e0c182f89e9c69d606df6cb0-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/402a0066e0c182f89e9c69d606df6cb0-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/402a0066e0c182f89e9c69d606df6cb0.jpeg 1000w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h4>Gc quay rng</h4>\r\n<p class=\"irIKAp\">Vi gc quay n tng ln n 170, camera hnh trnh 70mai M500 gip bn m rng tm quan st v hn ch cc gc quay cht, im m. Bn c th quan st ton b phng tin di chuyn  2 bn hng xe, nhng khong khng gian khng th quan st c thng qua gng chiu hu. ng thi h tr lu gi nhng khonh khc tuyt vi trn chuyn hnh trnh ca bn.</p>\r\n<p><img class=\"aligncenter wp-image-9182\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-5ccggirlpfjvdd-300x250.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-5ccggirlpfjvdd-300x250.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-5ccggirlpfjvdd-768x639.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-5ccggirlpfjvdd-600x499.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-5ccggirlpfjvdd.jpeg 1000w\" alt=\"\" width=\"600\" height=\"499\" loading=\"lazy\"></p>\r\n<h4 class=\"irIKAp\">Cht lng hnh nh cao, nng tm tri nghim cho ngi dng</h4>\r\n<ul>\r\n<li><strong>Camera hnh trnh  t 70Mai M500</strong>&nbsp;c trang b camera 5MP, ghi hnh Ultra HD 1944P Smart HDR cho hnh nh sc nt ngay c khi phng to.</li>\r\n<li>Vi  phn gii 2592 x 1944p 5megapixel, Camera hnh trnh 70mai M500 mang li cht lng hnh nh chn thc v r nt hn camera full HD bnh thng n 2.5 ln.  sc nt cao c th gip bn bt trn tng khonh khc cng nh s c khi di chuyn trn ng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9178\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/12bfde8c31abf2f6d66a3c38753c9df4-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/12bfde8c31abf2f6d66a3c38753c9df4-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/12bfde8c31abf2f6d66a3c38753c9df4-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/12bfde8c31abf2f6d66a3c38753c9df4-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/12bfde8c31abf2f6d66a3c38753c9df4-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/12bfde8c31abf2f6d66a3c38753c9df4-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/12bfde8c31abf2f6d66a3c38753c9df4.jpeg 1000w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h4>Cng ngh HDR (High Dynamic Range) nng cp tm nhn vo ban m</h4>\r\n<ul>\r\n<li>c trang b cng ngh HDR, sn phm hon ton c th chp c cc chi tit nh bin bo ng v bin s xe trong bt k iu kin nh sng no. HDR gip M500 t ng iu chnh  phi sng trong cc iu kin nh sng khc nhau, chp li hnh nh r nt  mi ni bn n.</li>\r\n<li>Vi tnh nng chp nh HDR cng khu  F2.0 thu ht nhiu nh sng, hnh nh thu c s m bo sc nt c trong iu kin thiu nh sng. Ngoi ra, sn phm c th ghi hnh ton din vi 5 triu im nh v trnh chiu tinh t.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9183\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-dig9sacnpfjv1f-300x249.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-dig9sacnpfjv1f-300x249.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-dig9sacnpfjv1f-768x637.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-dig9sacnpfjv1f-600x497.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-dig9sacnpfjv1f.jpeg 1000w\" alt=\"\" width=\"600\" height=\"497\" loading=\"lazy\"></p>\r\n<p><img class=\"aligncenter wp-image-9187\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-umyhhcknpfjv74-300x197.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-umyhhcknpfjv74-300x197.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-umyhhcknpfjv74-768x505.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-umyhhcknpfjv74-600x394.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-umyhhcknpfjv74.jpeg 960w\" alt=\"\" width=\"600\" height=\"394\" loading=\"lazy\"></p>\r\n<h4 class=\"irIKAp\">Gim st  xe 24 gi</h4>\r\n<ul>\r\n<li class=\"irIKAp\">Camera hnh trnh 70mai M500 cung cp chc nng gim st  xe 24h bng cch cho php ghi vng lp, ghi khn cp v ghi tua nhanh. Khi pht hin rung lc hoc va chm t ngt, camera hnh trnh M500 tch hp cm bin G c th cnh bo cho bn bng bng ging ni khi bn quay li xe kim tra.</li>\r\n<li class=\"irIKAp\">Bn hon ton c th yn tm  xe m khng lo s b mt chng c khi xy ra cc tnh hung rc ri. Cc bn ghi mi trn M500 c th t ng ghi  ln cc bn ghi c hn khi th nh ht dung lng (Video khn cp s khng b ghi ).</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9185\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-io7mtnbopfjv30-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-io7mtnbopfjv30-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-io7mtnbopfjv30-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-io7mtnbopfjv30-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-io7mtnbopfjv30-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-io7mtnbopfjv30-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-io7mtnbopfjv30.jpeg 1000w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Chp nh tua nhanh thi gian: 70mai Dash Cam M500 ghi 1 khung hnh mi giy. Bn cnh , sn phm cn h tr ghi vng lp, cho php nn cnh quay 30 pht thnh 1 pht  ti u ha b nh, cho php ghi lin tc trong thi gian di.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9191\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/7-11-300x188.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/7-11-300x188.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/7-11-768x480.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/7-11-600x375.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/7-11.jpg 800w\" alt=\"\" width=\"600\" height=\"375\" loading=\"lazy\"></p>\r\n<div class=\"irIKAp\">\r\n<div>\r\n<h4 class=\"irIKAp\">B nh eMMC tch hp</h4>\r\n<p class=\"irIKAp\">Camera hnh trnh 70mai M500 c trang b b nh tch hp eMMC h tr lu hnh nh th nh 32GB/64GB/128GB. Vi tc  ghi cao 110-150MB/s v tc  c nhanh 220-230MB/s, camera hnh trnh M500 c th mang li hiu qu hot ng n nh, trnh git lag khung hnh hay li ghi thng thng. B nh tch hp eMMC s hn ch cc ri ro m th nh thng thng mang li.</p>\r\n<p><img class=\"aligncenter wp-image-9184\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-fulggmzopfjvc9-224x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-fulggmzopfjvc9-224x300.jpeg 224w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-fulggmzopfjvc9-764x1024.jpeg 764w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-fulggmzopfjvc9-768x1030.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-fulggmzopfjvc9-600x805.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-fulggmzopfjvc9.jpeg 1000w\" alt=\"\" width=\"600\" height=\"805\" loading=\"lazy\"></p>\r\n</div>\r\n</div>\r\n<h4 class=\"irIKAp\"> chnh xc cao vi tch hp GPS &amp; GLONASS</h4>\r\n<ul>\r\n<li class=\"irIKAp\">Nhn tn hiu t h thng GPS &amp; GLONASS, camera hnh trnh 70mai M500 cung cp d liu v hnh trnh mt cch chnh xc v n nh, kt ni c nng cao.</li>\r\n<li class=\"irIKAp\">Ngi dng c th theo di hnh trnh theo thi gian thc gm tc  v ta , ng thi c th xc nh chnh xc v tr xe.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9186\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-qqt571urpfjv19-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-qqt571urpfjv19-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-qqt571urpfjv19-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-qqt571urpfjv19-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-qqt571urpfjv19-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-qqt571urpfjv19-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/sg-11134202-22110-qqt571urpfjv19.jpeg 800w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h4 class=\"irIKAp\">Cung cp tnh nng ADAS (Advanced Driver Assistance System)  Cnh bo, h tr li xe an ton</h4>\r\n<ul>\r\n<li class=\"irIKAp\">Nhm m bo an ton cho ngi s dng trong mi chuyn i, Camera hnh trnh 70mai M500 c nng cp h thng h tr ngi li thng minh ADAS, pht hin cc nguy him tim n v cnh bo n ngi li.</li>\r\n<li class=\"irIKAp\">ADAS gm 4 cnh bo chnh l cnh bo va chm, cnh bo lch ln, cnh bo ngi qua ng v li xe an ton. Cnh bo ngi i b gip pht hin chnh xc ngi i b v ngi i xe p bng cng ngh thng minh  a ra cnh bo kp thi.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9181\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/950575d966ba6d7c47153a1d55311ef7-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/950575d966ba6d7c47153a1d55311ef7-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/950575d966ba6d7c47153a1d55311ef7-150x150.jpeg 150w, https: