00vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-300x200.png 300w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-1024x683.png 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-768x512.png 768w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-600x400.png 600w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar.png 1200w\" alt=\"Gi  in thoi  t, kp in thoi  t Medicar Version 2\" width=\"600\" height=\"400\"></p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\">\r\n<h2>Thng Tin Sn Phm</h2>\r\n<ul>\r\n<li>Kch thc: 7.3 x 4.45 x 5.5 cm</li>\r\n<li>Cht liu: Hp kim nhm v nha ABS cao cp, gng Ceramic cng lc</li>\r\n<li>in p: DC- 5V (ngun USB trn  t)</li>\r\n<li>Sc pin: 250mAh (sc mt ln 30 pht c th dng trong 30 ngy)&nbsp;</li>\r\n<li>m: Cao su&nbsp;</li>\r\n<li>Auto: Kp t ng</li>\r\n<li>Xoay: 360 </li>\r\n<li>Mu: en</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-19677\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5-300x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5-300x300.png 300w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5-1024x1024.png 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5-150x150.png 150w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5-768x768.png 768w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5-600x600.png 600w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5-100x100.png 100w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-5.png 1200w\" alt=\"Gi  in thoi  t, kp in thoi  t Medicar Version 2\" width=\"600\" height=\"600\"></p>\r\n<h2>c im Ni Bt Ca Gi  in Thoi  T Medicar V2</h2>\r\n<h3>Thit k nh gn v hin i</h3>\r\n<p>Gi  in thoi Medicar Version 2 c thit k nh gn, hin i, khng gy cn gi khi t trn khe gi iu ho ca xe. Mu en sang trng, c tnh, ha hn s to im nhn ni bt cho mi khng gian ni tht xe.</p>\r\n<p><img class=\"aligncenter wp-image-19674\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-1-300x150.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-1-300x150.png 300w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-1-1024x512.png 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-1-768x384.png 768w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-1-600x300.png 600w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-1.png 1200w\" alt=\"\" width=\"600\" height=\"300\"></p>\r\n<h3>Phn chn kp chc chn v cng cp</h3>\r\n<p>Sn phm c lm t hp kim nhm v nha ABS cao cp nn c cu to rt cng cp. Phn chn kp chc chn gip nng  in thoi  mi kch c khc nhau m khng s lm gy ca gi iu ho.</p>\r\n<p><img class=\"aligncenter wp-image-19676\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-3-300x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-3-300x300.png 300w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-3-1024x1024.png 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-3-150x150.png 150w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-3-768x768.png 768w, https://www.cavaha.com/wp-content/uploads/2024/08/giadodienthoaithongmingv2medicar-3-600x60