o-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"YY1AYHK\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><h2 class=\"product_title entry-title elementor-heading-title elementor-size-default\">My Ht Bi Cm Tay Khng Dy Pro Medicar Cho  T</h2>\r\n<div class=\"ace-line ace-line old-record-id-AtZWdK7hooivaNxHU93uPmjxsub\"><em>My ht bi cm tay khng dy Pro Medicar mang n gii php loi b bi bn, lm sch khng gian xe n 99,95%. ng thi gii phng ni lo dy in rc ri v bt tin m nhng loi my khc khng p ng c. My ht bi khng dy Medicar cn s hu dung lng pin ln n 2000mAh, sc 1 ln dng lin tc 30 pht.</em></div>\r\n<div>&nbsp;</div>\r\n<div class=\"ace-line ace-line old-record-id-AtZWdK7hooivaNxHU93uPmjxsub\"><em>S dng cng ngh o chiu khng kh hin i nht 2023, my c kh nng ht v thi bi sch s</em><em><strong>.&nbsp;</strong></em><em>Ngoi ra, cn c s dng a nhim nh mt sn phm thi bi v ht chn khng gip bn tim kim mt khon chi ph khng h nh.</em></div>\r\n<div>&nbsp;</div>\r\n<h3><img class=\"aligncenter wp-image-19813\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x-1024x1024.jpg 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-1_1500x.jpg 1500w\" alt=\"My Ht Bi Cm Tay Khng Dy Pro Medicar Cho  T\" width=\"600\" height=\"600\"></h3>\r\n<h3>Thng Tin Sn Phm My Ht Bi Cm Tay Khng Dy Pro Medicar</h3>\r\n<p>in p: DC 7.4V/12V</p>\r\n<p>Cng sut: 100W/120W</p>\r\n<p>Dung lng pin: 2000mAh</p>\r\n<p>Thi gian sc: ~4h</p>\r\n<p>B lc: Cht liu thp khng g</p>\r\n<p>Ph kin ht bi: 1 u ht phng, 1 u chi ht</p>\r\n<p>Ph kin bm: 3 u bm linh hot</p>\r\n<p>Dy sc: Type C</p>\r\n<p>Khc: Ti ng bo qun i km</p>\r\n<h3><img class=\"aligncenter wp-image-19820\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-1024x1024.jpg 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-1536x1536.jpg 1536w, https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/z4823390394536_2f53facabfdbea5a9ad7f26218babd9b.jpg 1857w\" alt=\"\" width=\"600\" height=\"600\"></h3>\r\n<h3>Tnh Nng Ni Bt Ca My Ht Bi Cm Tay Khng Dy Pro Medicar</h3>\r\n<div data-page-id=\"MxtBdricfofGB0x07WJuvBxasyb\" data-docx-has-block-data=\"false\">\r\n<h4 class=\"ace-line ace-line old-record-id-AtZWdK7hooivaNxHU93uPmjxsub\"><strong>Lc ht mnh m ln n 8.500 PA</strong></h4>\r\n<div class=\"ace-line ace-line old-record-id-VJP9dfPpzoNPTaxEuhMuGYlhsUf\">Tit kim thi gian ti a vi my ht bi  t Medicar nh lc ht vt tri gip lm sch ton b khng gian ch vi 5 pht, nhanh hn x5 ln so vi vic lm sch thng thng. Sn phm c kh nng loi b mi loi bi cng u, tc, vn thc n, bi mn n 10PM. Sc kho h hp ca bn s c bo v ti a nh khng gian c lm sch gn nh tuyt i.</div>\r\n</div>\r\n<div data-docx-has-block-data=\"false\" data-page-id=\"MxtBdricfofGB0x07WJuvBxasyb\">\r\n<div class=\"ace-line ace-line old-record-id-CI2adCLJGopjTYxkxpsuEeJCsAh\">Mc d my c cng sut ln n 8.500PA nhng bn cng khng phi lo lng v ting n gy kh chu khi ang s dng v ng c hot ng kh m tai.</div>\r\n<div class=\"ace-line ace-line old-record-id-OSsUdf4eOo4mzTxqbnHuvv4tsnb\">My c 2 cp : Eco (tit kim pin) v Power (nng lng cao)</div>\r\n</div>\r\n<p><img class=\"aligncenter wp-image-19814\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2-1024x1024.jpg 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_2.jpg 1500w\" alt=\"My Ht Bi Cm Tay Khng Dy Pro Medicar Cho  T\" width=\"600\" height=\"600\"></p>\r\n<h4 class=\"ace-line ace-line old-record-id-OSsUdf4eOo4mzTxqbnHuvv4tsnb\"><strong>Cng ngh o chiu khng kh hin i: 1 u ht v 1 u thi</strong></h4>\r\n<div class=\"ace-line ace-line old-record-id-Z3KodIu0DoWqFOxdqemukAJXspc\">Ch vi duy nht 1 thit b, bn  c th s dng 2 chc nng ht v thi bi. Lm sch khng gian nh kh nng ht bi nh cao. Cng c th s dng  thi sch mnh vn hay bi trn nn nh hoc b mt thit b in t, Hoc c th s dng  bm ging hi, phao bi v cc vt dng tng t. Kch thc nh gn nhng mang li hiu sut cc cao, gip tit kim 1 khon chi ph ln.</div>\r\n<div>&nbsp;</div>\r\n<h4 class=\"ace-line ace-line old-record-id-Z3KodIu0DoWqFOxdqemukAJXspc\"><strong>S dng cho nhiu v tr khc nhau nh 3 u ht linh hot</strong></h4>\r\n<div class=\"ace-line ace-line old-record-id-XeUddimqgoZ6texAdikui1oSsK9\">Khng ch c s dng trn  t, my ht bi cm tay Medicar cn c th c tn dng  ht trong nh, trong phng ng, trn ging, bn phm my tnh,.m khng lnh knh dy in. Lc ht 8000PA p ng nhu cu lm sch c  trong khng gian nh nh  t cng nh trong nhng khng gian ln hn.</div>\r\n<div class=\"ace-line ace-line old-record-id-XeUddimqgoZ6texAdikui1oSsK9\">&nbsp;</div>\r\n<div class=\"ace-line ace-line old-record-id-EyYbd3gDioA3dMxem7ruwp3zsog\">Cc k, ngch kh v sinh nht u c gii quyt gn gh bi my lc khng kh Medicar. 2 u ht linh hot, c th iu chnh bng 1 gt tay gip ti u kh nng lm sch cc b mt khc nhau:</div>\r\n<div class=\"ace-line ace-line old-record-id-Zo9fdmH7zooGMRxgnAduJ4fosoc\">+ Vi ht ln: nn nh, bn gh,</div>\r\n<div class=\"ace-line ace-line old-record-id-CRp2dHZrsoFCWkxXzsQuN313sk1\">+ u ht phng:  t, khe h, gc hp, cc khu vc kh tip cn</div>\r\n<div class=\"ace-line ace-line old-record-id-XSxFdwBVEolMocxKz3Nu62yKsEg\">+ u qut: khe gi iu ha, thm sn, chn, bn phm.</div>\r\n<p><img class=\"aligncenter wp-image-19819\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-1024x1024.jpg 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-1536x1536.jpg 1536w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-2048x2048.jpg 2048w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_12-100x100.jpg 100w\" alt=\"My Ht Bi Cm Tay Khng Dy Pro Medicar Cho  T\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<div data-docx-has-block-data=\"false\" data-page-id=\"MxtBdricfofGB0x07WJuvBxasyb\">\r\n<h4 class=\"ace-line ace-line old-record-id-DztNd9yJvoMRcjx0WPuuAeCksWq\"><strong>B lc li thp hin i gip loi b bi mn</strong></h4>\r\n</div>\r\n<div data-docx-has-block-data=\"false\" data-page-id=\"MxtBdricfofGB0x07WJuvBxasyb\">\r\n<div class=\"ace-line ace-line old-record-id-Z1qbdUPgtoBd4Yxn8OyueL3LsGb\">Khng kh trong xe, trong nh tr nn trong lnh hn nh kh nng lc sch bi mn m&nbsp;bn khng th nhn thy&nbsp;ca b lc li thp&nbsp;s dng trn i. Lc n 99,95% bi mn PM2.5. Khng cn tn chi ph thay th b lc hng nm nh kh nng ti s dng ca b lc (v sinh bng cch ra sch vi nc)</div>\r\n</div>\r\n<p><img class=\"aligncenter wp-image-19817\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_9-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_9-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_9-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_9-768x769.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_9-600x601.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_9-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_9.jpg 912w\" alt=\"My Ht Bi Cm Tay Khng Dy Pro Medicar Cho  T\" width=\"600\" height=\"601\" loading=\"lazy\"></p>\r\n<div data-docx-has-block-data=\"false\" data-page-id=\"MxtBdricfofGB0x07WJuvBxasyb\">\r\n<h4 class=\"ace-line ace-line old-record-id-VfAQdE6VTohhpHxsJtBuqSiVsBg\"><strong>Hot ng bn b n 30p lin tc nh dung lng pin ln n 2000mAh</strong></h4>\r\n</div>\r\n<div data-docx-has-block-data=\"false\" data-page-id=\"MxtBdricfofGB0x07WJuvBxasyb\">\r\n<div class=\"ace-line ace-line old-record-id-DztNd9yJvoMRcjx0WPuuAeCksWq\">Nh dung lng pin khng ln n 2000mAh, bn c th s dng my lin tc trong vng 30 pht m lc ht khng h suy gim hay lm nng my. My ht bi Medicar m bo hiu sut lm vic hiu qu, gip bn tit kim thi gian v cng sc ng k trong vn  dn dp hng ngy.</div>\r\n</div>\r\n<p><img class=\"aligncenter wp-image-19816\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6-1024x1024.jpg 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_6.jpg 1500w\" alt=\"My Ht Bi Cm Tay Khng Dy Pro Medicar Cho  T\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h4>Tch hp chc nng bm hi linh hot</h4>\r\n<p>Tn dng 3 u bm a dng kch thc  bm ging hi, phao bi, bng r, v cc vt dng gia nh mt cch tin li. Sn phm l ngi bn hu ch cho c gia nh v c kh nng ng dng trong nhiu tnh hung khc nhau.</p>\r\n<p><img class=\"aligncenter wp-image-19815\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_5_9fbe5d80-3890-433b-a685-ab739b04b7f6_720x-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_5_9fbe5d80-3890-433b-a685-ab739b04b7f6_720x-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_5_9fbe5d80-3890-433b-a685-ab739b04b7f6_720x-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_5_9fbe5d80-3890-433b-a685-ab739b04b7f6_720x-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_5_9fbe5d80-3890-433b-a685-ab739b04b7f6_720x-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/May-hut-bui-cam-tay-khong-day-o-to-Medicar-luc-hut-vuot-troi-den-8500PA-bao-hanh-1-doi-1-12-thang_5_9fbe5d80-3890-433b-a685-ab739b04b7f6_720x.jpg 720w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h4>Thit k nh gn gip d dng thao tc</h4>\r\n<div data-docx-has-block-data=\"false\" data-page-id=\"MxtBdricfofGB0x07WJuvBxasyb\">\r\n<div class=\"ace-line ace-line old-record-id-IWdldr8Ino2egXxeKwuu8CtMsUd\">n gin ha vic lm sch  t v nh ca khi s dng my ht bi khng dy Medicar. Khng cn dy in rc ri, hnh dng v trng lng di 1kg ca my cn gip bn c th cm nm, di chuyn mi ngc ngch trong thi gian di m khng gy mi tay. Kch thc cng l im cng khi c th t  nhng v tr nh hc ca, cp xe, taplo. Ngoi ra, vic v sinh khoang cha bi v b lc cng v cng n gin, tho lp v sinh ch trong 60s.</div>\r\n</div>\r\n<p><img class=\"aligncenter wp-image-19821\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4-1024x1024.jpg 1024w, https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/z4830894406020_02a0b749ac5929a069400a9ff65602e4.jpg 1500w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h3>Hng Dn S Dng My Ht Bi Cm Tay Khng Dy Pro Medicar</h3>\r\n<div class=\"ace-line ace-line old-record-id-IbcSdLuG4o875WxA9oHur1ktslg\">Bc 1: Sc my ht bi Medicar trong vng 4 gi.</div>\r\n<div class=\"ace-line ace-line old-record-id-IbcSdLuG4o875WxA9oHur1ktslg\">n xanh th hin trng thi  c sc y v n  th hin trng thi ang sc.</div>\r\n<div class=\"ace-line ace-line old-record-id-LSuedffAroxYE1xyIx2uBFwPsDh\">Bc 2: Lp b lc vo khoang cha bi</div>\r\n<div class=\"ace-line ace-line old-record-id-A4v9dzclBoCNy0xvmysuOgLisvY\">Bc 3: Lp ng c vo khoang cha bi</div>\r\n<div class=\"ace-line ace-line old-record-id-MHZVdzW8goJAPvxmy2wua3hpsbc\">Bc 4: Nhn v gi cng tc trong 0,5 giy  khi ng ch  tiu chun, nhn mt ln na  vo ch  mnh, v nhn mt ln na  tt my</div>\r\n<div>&nbsp;</div>\r\n<div class=\"ace-line ace-line old-record-id-HHMkdqAVNoh6s8xZmXgudlfts9b\"><strong>Hng dn v sinh:&nbsp;</strong>Tho ri khoang cha bi,  bi, v sinh b lc v khoang cha, lp li my v s dng.</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<h3><strong>Quyn Li Ca Khch Hng Khi Chn Mua Sn Phm Ti Cavaha Auto  Th Gii  Chi Xe Hi:</strong></h3>\r\n<ul>\r\n<li>Khch hng c tip nhn sn phm theo quy trnh: nhn hng  kim tra  thanh ton. Nu qu khch khng hi lng v sn phm c th t chi nhn hng.</li>\r\n<li>Cavaha Auto cung cp chnh sch 1 i 1 trong vng 30 ngy v cam kt bo hnh trong vng 12 thng i vi tt c sn phm ti ca hng.</li>\r\n</ul>\r\n</div></div></div></div>'),(180,85,0,103,'My Ht Bi Cm Tay Khng Dy Pro Medicar Cho  T'),(181,75,0,104,'<style>#html-body [data-pb-style=GKRP14W]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"GKRP14W\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><h2>My Ht Bi Cm Tay Khng Dy, My Ht Bi  T Tin Dng</h2>\r\n<ul>\r\n<li>Bn thng xuyn phi s dng  t cho nhng chuyn i cng tc, du lch, khin x yu rt d bm bi bn c trong ln ngoi?</li>\r\n<li>Bn hoc gia nh c thi quen n ung trn xe.  n, nc ung b , ri vi trn cabin, gh xe, sn xe, khin cc khu vc ny nhanh b bn v xung cp?</li>\r\n<li>Bn ang tm mt sn phm c kh nng v sinh ni tht  t, v sinh vn phng&nbsp; nhanh chng, tin li. Hy cng&nbsp;<a href=\"https://www.cavaha.com/\"><strong>Cavaha Auto</strong></a>&nbsp;tm hiu sn phm my ht bi cm tay khng dy tin li nh!</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-20413\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-6-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-6-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-6-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-6-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-6-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-6-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-6.jpg 800w\" alt=\"\" width=\"600\" height=\"600\"></p>\r\n<h3>Thng Tin My Ht Bi:</h3>\r\n<ul>\r\n<li>Cng sut ln ln n 120W ht bi cc mnh.</li>\r\n<li>S dng mn lc kh HEPA cao cp, tin tin.</li>\r\n<li>Ph kin: ng di, 2 u ni, u ht di, bn chi, dy sc</li>\r\n<li>Dung lng pin: 4000mAh</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-20418\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to.jpg 800w\" alt=\"\" width=\"600\" height=\"600\"></p>\r\n<h3>c im cu to ca sn phm my ht bi:</h3>\r\n<ul>\r\n<li>Kch thc my ht bi : 33x14x10cm.</li>\r\n<li>Trng lng my ht ln n 1.5kg.</li>\r\n<li>My ht bi c thit k nh gn ,cm tay rt thun tin cho vic v sinh.</li>\r\n<li>Thi gian s dng ca Pin lu ko di lin tc 4-5h m khng lo s b chai Pin.</li>\r\n<li>My c th s dng cho mi loi dng xe  t gia nh t 4-7 ch.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-20415\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-8-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-8-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-8-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-8-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-8-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-8-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-8.jpg 800w\" alt=\"\" width=\"600\" height=\"600\"><img class=\"aligncenter wp-image-20416\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-9-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-9-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-9-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-9-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-9-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-9-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-9.jpg 800w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<p><img class=\"aligncenter wp-image-20417\" src=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-10-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-10-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-10