2-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-2-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-2-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-2-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2024/08/may-hut-bui-o-to-2.jpg 800w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p></div></div></div>'),(182,85,0,104,'My Ht Bi Cm Tay Khng Dy, My Ht Bi  T Tin Dng'),(183,75,0,105,'<style>#html-body [data-pb-style=B9RYVSN]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"B9RYVSN\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p>My Phun Sng To m, Xng Tinh Du  T Baseus Chnh Hng gip cn bng  m, chng hanh kh v to khng gian thong mt, thoi mi cho ngi s dng. Vi thit k nh gn, sang trng v tinh t, sn phm chc chn s l mn ph kin v cng tin ch  s dng trong nh, trn  t, vn phng, vo nhng ngy tri nng.</p>\r\n<p><img class=\"aligncenter wp-image-9532\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus.jpg 800w\" alt=\"my phun sng  t baseus\" width=\"600\" height=\"600\"></p>\r\n<h3>Thng tin sn phm</h3>\r\n<ul>\r\n<li>Thng hiu: Baseus</li>\r\n<li>Tn sn phm: My Phun Sng To m, Xng Tinh Du  T Mini</li>\r\n<li>Model: DHSG1</li>\r\n<li>Cht liu sn phm: Hp kim nhm, nha PC v nha ABS cao cp.</li>\r\n<li>Mu sc sn phm: Mu xm m</li>\r\n<li>Kch thc sn phm: 132*70 mm</li>\r\n<li>Trng lng sn phm: 200g</li>\r\n<li>Power input: DC 5V/1.2A</li>\r\n<li>Cng sut nh mc: 6W</li>\r\n<li>Dung tch cha nc ti a: 75ml</li>\r\n<li>Mc  phun sng: 20-35ml/h.</li>\r\n<li>S dng c trong nhiu khng gian khc nhau nh:  t, phng lm vic, phng ng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9535\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus_3-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus_3-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus_3-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus_3-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus_3-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus_3-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/may_phun_suong_baseus_3.jpeg 800w\" alt=\"\" width=\"600\" height=\"600\"></p>\r\n<h3><strong>u im ni bt ca My Phun Sng  T Baseus</strong></h3>\r\n<ul>\r\n<li>Sn phm c kh nng phun sng to m cho khp khng gian xe, m bo cht lng khng kh lun trong trng thi l tng cho ngi s dng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9530\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/20392167d091fa4bcedefd0a9ab10407-209x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/20392167d091fa4bcedefd0a9ab10407-209x300.jpeg 209w, https://www.cavaha.com/wp-content/uploads/2023/03/20392167d091fa4bcedefd0a9ab10407-713x1024.jpeg 713w, https://www.cavaha.com/wp-content/uploads/2023/03/20392167d091fa4bcedefd0a9ab10407-768x1102.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/20392167d091fa4bcedefd0a9ab10407-600x861.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/20392167d091fa4bcedefd0a9ab10407.jpeg 930w\" alt=\"my phun sng  t baseus\" width=\"600\" height=\"861\"></p>\r\n<ul>\r\n<li class=\"irIKAp\">My phun sng to m mini Baseus c 2 ch  phun sng c bit bao gm phun sng lin tc v phun sng ngt qung.</li>\r\n</ul>\r\n<p>  bt u ch  phun sng lin tc, bn ch cn nhn nt mt ln.</p>\r\n<p>  bt u ch  phun sng ngt qung, bn nhn nt 2 ln v khong thi gian ngt qung s l 15 giy.</p>\r\n<p><img class=\"aligncenter wp-image-9539\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/503e0edb84b8975954fae01a31b1dc16-1-170x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/503e0edb84b8975954fae01a31b1dc16-1-170x300.jpeg 170w, https://www.cavaha.com/wp-content/uploads/2023/03/503e0edb84b8975954fae01a31b1dc16-1-581x1024.jpeg 581w, https://www.cavaha.com/wp-content/uploads/2023/03/503e0edb84b8975954fae01a31b1dc16-1-768x1354.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/503e0edb84b8975954fae01a31b1dc16-1-871x1536.jpeg 871w, https://www.cavaha.com/wp-content/uploads/2023/03/503e0edb84b8975954fae01a31b1dc16-1-600x1058.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/503e0edb84b8975954fae01a31b1dc16-1.jpeg 930w\" alt=\"\" width=\"600\" height=\"1058\" loading=\"lazy\"></p>\r\n<ul>\r\n<li class=\"irIKAp\">Sn phm dng cng ngh sng siu m  to ra cc phn t nc siu mn cho hiu sut s dng cao hn. c bit c th dng vi cc loi tinh du tt hn, bn hn v khng gy nght nh cc loi s dng li coton thng thng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9528\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/023477d62702e7c13228a355a573207f-237x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/023477d62702e7c13228a355a573207f-237x300.jpeg 237w, https://www.cavaha.com/wp-content/uploads/2023/03/023477d62702e7c13228a355a573207f-808x1024.jpeg 808w, https://www.cavaha.com/wp-content/uploads/2023/03/023477d62702e7c13228a355a573207f-768x973.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/023477d62702e7c13228a355a573207f-600x760.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/023477d62702e7c13228a355a573207f.jpeg 930w\" alt=\"\" width=\"600\" height=\"760\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Sn phm cn c trang b n LED trang tr vi nhiu mu sc v ch  sng linh hot. Khng ch c tc dng phun sng m my cn l vt phm trang tr p mt trn bn lm vic, phng khch, phng ng hay  t.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9538\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__13_f2955b32a7474c33949ee4b3cda0bbd8-174x300.webp\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__13_f2955b32a7474c33949ee4b3cda0bbd8-174x300.webp 174w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__13_f2955b32a7474c33949ee4b3cda0bbd8-594x1024.webp 594w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__13_f2955b32a7474c33949ee4b3cda0bbd8-768x1325.webp 768w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__13_f2955b32a7474c33949ee4b3cda0bbd8-891x1536.webp 891w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__13_f2955b32a7474c33949ee4b3cda0bbd8-600x1035.webp 600w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__13_f2955b32a7474c33949ee4b3cda0bbd8.webp 930w\" alt=\"\" width=\"600\" height=\"1035\" loading=\"lazy\"></p>\r\n<ul>\r\n<li class=\"irIKAp\">Sn phm s dng ngun in 5V, tng thch vi nhiu thit b khc nhau. Bn c th cm trc tip vo tu sc trn  t hoc cng USB trn my tnh, cc b sc, pin sc d phng ca in thoi hay tablet thng thng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9540\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/15ffa19df4a1874d81d9db53dedb9683-201x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/15ffa19df4a1874d81d9db53dedb9683-201x300.jpeg 201w, https://www.cavaha.com/wp-content/uploads/2023/03/15ffa19df4a1874d81d9db53dedb9683-686x1024.jpeg 686w, https://www.cavaha.com/wp-content/uploads/2023/03/15ffa19df4a1874d81d9db53dedb9683-768x1146.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/15ffa19df4a1874d81d9db53dedb9683-600x895.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/15ffa19df4a1874d81d9db53dedb9683.jpeg 930w\" alt=\"\" width=\"600\" height=\"895\" loading=\"lazy\"></p>\r\n<ul>\r\n<li class=\"irIKAp\">Thit k c ng, nh gn c th  va vo ngn cha cc trn xe hi,  trn bn lm vic m khng chim nhiu din tch. Np y chc chn, khng gy  nc k c khi b nghing hay ri rt. y chc chn s l mt chic my phun sng to m chuyn dng, tin li dnh cho chic  t ca bn.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9524\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/1f339120d3ca93a824de2358e366f926-265x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/1f339120d3ca93a824de2358e366f926-265x300.jpeg 265w, https://www.cavaha.com/wp-content/uploads/2023/03/1f339120d3ca93a824de2358e366f926-905x1024.jpeg 905w, https://www.cavaha.com/wp-content/uploads/2023/03/1f339120d3ca93a824de2358e366f926-768x869.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/1f339120d3ca93a824de2358e366f926-600x679.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/1f339120d3ca93a824de2358e366f926.jpeg 930w\" alt=\"my phun sng  t baseus\" width=\"600\" height=\"679\" loading=\"lazy\"></p>\r\n<p><img class=\"aligncenter wp-image-9526\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/38dd6dca80b4df9acaa067fe28bba008-198x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/38dd6dca80b4df9acaa067fe28bba008-198x300.jpeg 198w, https://www.cavaha.com/wp-content/uploads/2023/03/38dd6dca80b4df9acaa067fe28bba008-676x1024.jpeg 676w, https://www.cavaha.com/wp-content/uploads/2023/03/38dd6dca80b4df9acaa067fe28bba008-768x1163.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/38dd6dca80b4df9acaa067fe28bba008-600x908.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/38dd6dca80b4df9acaa067fe28bba008.jpeg 930w\" alt=\"my phun sng  t baseus\" width=\"600\" height=\"908\" loading=\"lazy\"></p>\r\n<h3>Cng dng&nbsp;<strong>ni bt ca My Phun Sng  T Baseus</strong></h3>\r\n<ul>\r\n<li>Sn phm c tc dng khuch tn cc phn t nc hoc tinh du dng nano siu mn ra mi trng khng kh. Qu trnh ny gip ti to v cn bng  m trong khng kh mt cch t nhin, lm mt v kh mi hiu qu. Bn s qun ngay cm gic kh chu do mi hi xe gy ra, thoi mi tn hng khng gian thong mt ch sau vi pht.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9531\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/bf18e93fc55c404ab479b98d07f57913-204x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/bf18e93fc55c404ab479b98d07f57913-204x300.jpeg 204w, https://www.cavaha.com/wp-content/uploads/2023/03/bf18e93fc55c404ab479b98d07f57913-696x1024.jpeg 696w, https://www.cavaha.com/wp-content/uploads/2023/03/bf18e93fc55c404ab479b98d07f57913-768x1130.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/bf18e93fc55c404ab479b98d07f57913-600x883.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/bf18e93fc55c404ab479b98d07f57913.jpeg 930w\" alt=\"my phun sng  t baseus\" width=\"600\" height=\"883\" loading=\"lazy\"></p>\r\n<h3>Hng dn s dng sn phm</h3>\r\n<ul>\r\n<li>Bc 1: M np ra v  nc (nc my/nc khong) vo.</li>\r\n</ul>\r\n<p>Lu : Lng nc  vo khng c vt qu mc nc c nh du cao nht.</p>\r\n<ul>\r\n<li>Bc 2: Nh khong 2-4 git tinh du vo trong bnh cha nc.</li>\r\n<li>Bc 3: y np bnh cha nc. Kt ni u USB ca dy ngun vi cng cp ngun ca b chuyn i (Ngun in yu cu: DC 5V, dng in ln hn 1A).</li>\r\n<li>Bc 4: Sau khi bt ngun in, nhn nt khi ng  bt u s dng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9537\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__14_672e578ac951462c85929787693da9cf-174x300.webp\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__14_672e578ac951462c85929787693da9cf-174x300.webp 174w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__14_672e578ac951462c85929787693da9cf-593x1024.webp 593w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__14_672e578ac951462c85929787693da9cf-768x1327.webp 768w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__14_672e578ac951462c85929787693da9cf-889x1536.webp 889w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__14_672e578ac951462c85929787693da9cf-600x1037.webp 600w, https://www.cavaha.com/wp-content/uploads/2023/03/time_aromatherapy__14_672e578ac951462c85929787693da9cf.webp 930w\" alt=\"\" width=\"600\" height=\"1037\" loading=\"lazy\"></p>\r\n<h3><strong>Quyn li ca khch hng khi chn mua sn phm ti Cavaha Auto  Th gii  chi xe hi:</strong></h3>\r\n<ul>\r\n<li>Khch hng c tip nhn sn phm theo quy trnh: nhn hng  kim tra  thanh ton. Nu qu khch khng hi lng v sn phm c th t chi nhn hng.</li>\r\n<li>Cavaha Auto cung cp chnh sch 1 i 1 trong vng 30 ngy. V cam kt bo hnh trong vng 12 thng i vi tt c sn phm ti ca hng.</li>\r\n</ul></div></div></div>'),(184,85,0,105,'My Phun Sng To m, Xng Tinh Du  T Baseus'),(185,75,0,106,'<style>#html-body [data-pb-style=NMMOIDY]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"NMMOIDY\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p><strong>B khuch tn tinh du nc hoa  t Baseus</strong>&nbsp;l ph kin  t c sn n nhiu nht bi cng dng kh mi v to hng thm cho x yu. Ch cn t sn phm ny trn taplo xe, hng thm c khuch tn s khin nhng chuyn i xa mt mi tr nn thoi mi v th gin hn bao gi ht.</p>\r\n<p><img class=\"aligncenter wp-image-9380\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus.jpg 800w\" alt=\"\" width=\"600\" height=\"600\"></p>\r\n<h3><strong>Thng tin sn phm b khuch tn tinh du nc hoa  t Baseus</strong></h3>\r\n<ul>\r\n<li>Tn sn phm: My khuch tn tinh du, nc hoa</li>\r\n<li>Thng hiu sn phm: Baseus</li>\r\n<li>Cht liu sn phm: Hp kim nhm ph sn tnh in siu bn</li>\r\n<li>Hng nc hoa: Cologne*2, Ocean*1, Lemon*1</li>\r\n<li>Kch thc sn phm: 64,764,726,53mm (DRC)</li>\r\n<li>Trng lng sn phm: ~41,9g</li>\r\n<li>S dng ph hp cho tt c cc loi xe  t t 4  7 ch, xe ti,</li>\r\n<li>Cng dng: Khuch tn tinh du, nc hoa cho xe  t, phng ng, phng lm vic,</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9369\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/3-28-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/3-28-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/3-28-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/3-28-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/3-28-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/3-28-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/3-28.jpg 800w\" alt=\"\" width=\"600\" height=\"600\"></p>\r\n<h3>u im ni bt ca&nbsp;<strong>B khuch tn tinh du nc hoa  t Baseus</strong></h3>\r\n<ul>\r\n<li>B khuch tn tinh du, nc hoa Baseus c thit k dng a trn n gin, mu sc tinh t v s hu kch thc siu nh gn. Sn phm c th t trn taplo xe, khng h chim din tch hay lm khut tm nhn.</li>\r\n<li>Cht liu cu thnh nn sn phm ch yu l hp kim nhm. B mt c ph lp sn tnh in  chng bm vn tay v gi cho lp sn khng b bong, trc sau thi gian di s dng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9382\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-02-173x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-02-173x300.png 173w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-02-592x1024.png 592w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-02-768x1329.png 768w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-02-888x1536.png 888w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-02-600x1038.png 600w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-02.png 930w\" alt=\"\" width=\"600\" height=\"1038\"></p>\r\n<ul>\r\n<li>Sn phm c th xoay linh hot  iu chnh tc  khuch tn mi hng.</li>\r\n<li>Nc hoa c chit xut hon ton t thin nhin, khng cha cn v an ton cho sc khe (c bit l da tay). Sn phm  t chng ch an ton cho sc khe RoHS safety certified (Restrict of Hazardous Substances). An ton cho mi i tng k c ngi gi, tr em hay ph n mang thai.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9373\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/add4b5a4418f4585ef08be1041be6b8a-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/add4b5a4418f4585ef08be1041be6b8a-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/add4b5a4418f4585ef08be1041be6b8a-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/add4b5a4418f4585ef08be1041be6b8a-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/add4b5a4418f4585ef08be1041be6b8a-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/add4b5a4418f4585ef08be1041be6b8a.jpeg 700w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>B khuch tn Baseus km nc hoa dng cho xe hi gm 4 thi nc hoa kh vi cc mi hng nh: Cologne*2, Ocean*1, Lemon*1&nbsp;&nbsp;. Thi gian s dng cc lu ln n hn 2 nm. Mt thi c th dng khong 5 thng. Nc hoa c mi hng nh nhng, ti mt, d chu giup khi dy cm gic sng khoi.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9375\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-04-177x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-04-177x300.png 177w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-04-603x1024.png 603w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-04-768x1303.png 768w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-04-905x1536.png 905w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-04-600x1018.png 600w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-04.png 930w\" alt=\"\" width=\"600\" height=\"1018\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Di y my khuch tn c sn mt ming dn 3M chc chn gip bn d dng c nh sn phm trn mi b mt. c bit: khng s try xc b mt xe khi dn, tho ra dn li nhiu ln vn bm dnh cc tt.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9376\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/cd2af6e14f2f0b0ce40fa8920a5cb6a6-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/cd2af6e14f2f0b0ce40fa8920a5cb6a6-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/cd2af6e14f2f0b0ce40fa8920a5cb6a6-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/cd2af6e14f2f0b0ce40fa8920a5cb6a6-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/cd2af6e14f2f0b0ce40fa8920a5cb6a6-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/cd2af6e14f2f0b0ce40fa8920a5cb6a6.jpeg 700w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Vi thit k nh gn, sn phm c s dng rng ri trong mi khng gian sinh hot nh: phng khch, phng ng, t qun o, xe hi, T y khng gian sng s tr nn thoi mi v d chu hn bao gi ht.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9381\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-01-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-01-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-01-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-01-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-01-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-01-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-01.jpg 800w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Sn phm rt thch hp  lm qu tng cho bn b, i tc hay nhng ngi thn yu v thit k ng hp v cng tinh t v sang trng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9372\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/33802c6f6995d5884b715acfadc4f923-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/33802c6f6995d5884b715acfadc4f923-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/33802c6f6995d5884b715acfadc4f923-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/33802c6f6995d5884b715acfadc4f923-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/33802c6f6995d5884b715acfadc4f923-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/33802c6f6995d5884b715acfadc4f923.jpeg 700w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h3><strong>Cng dng ni bt ca B khuch tn tinh du nc hoa  t Baseus</strong></h3>\r\n<ul>\r\n<li>My khuch tn tinh du nc hoa Bases c tc dng kh mi hi t ni tht xe, mi m mc kh chu do  n, nc ung,.. Nu khng v sinh xe thng xuyn, bn c th khin cho khng gian xe tr nn ngt ngt v ngi thn ca chng ta s d b say xe ngay khi va bc ln.</li>\r\n</ul>\r\n<ul>\r\n<li>Sn phm c th xua tan hon ton cm gic say xe cho nhng ngi thn yu ca chng ta, nhng ngi c sc khe yu. Mt trong nhng nguyn nhn chnh gy ra cm gic ny l do mi hi v khng kh ngt ngt trong xe.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9370\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/5372dc5a4aa96d6b85c2eeea5ebb5118-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/5372dc5a4aa96d6b85c2eeea5ebb5118-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/5372dc5a4aa96d6b85c2eeea5ebb5118-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/5372dc5a4aa96d6b85c2eeea5ebb5118-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/5372dc5a4aa96d6b85c2eeea5ebb5118-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/5372dc5a4aa96d6b85c2eeea5ebb5118.jpeg 700w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<ul>\r\n<li>Ngoi ra, hng thm khuch tn khp xe s gip gia tng cm hng li xe cho cc bc ti trong nhng chuyn i ng di. ng thi, nhng ngi ngi trong xe cng s cm thy thoi mi, th gin hn rt nhiu.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9380\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus.jpg 800w\" alt=\"\" width=\"600\" height=\"600\"></p>\r\n<ul>\r\n<li>Nu bn l mt ti x li xe, s hu sn phm ny c th gip bn to n tng vi khch hng tt hn. T  s d dng thu ht c mt lng khch ln book xe ca bn.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9368\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-06-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-06-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-06-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-06-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-06-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-06-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/nuoc-hoa-baseus-tren-o-to-06.jpg 800w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p>\r\n<h3>Hng dn s dng sn phm:</h3>\r\n<ul>\r\n<li>Bc 1: M np b khuch tn tinh du.</li>\r\n<li>Bc 2: t ming thm tinh du vo trong.</li>\r\n<li>Bc 3: y np b khuch tn tinh du, nc hoa li.</li>\r\n<li>Bc 4: G ming dn 3M di y b khuch tn ra ri dn vo v tr bn mun.</li>\r\n<li>Bc 5: Sau khi nh xong tinh du, bn i mt lc  my khuch tn mi hng.</li>\r\n</ul>\r\n<p><img class=\"aligncenter wp-image-9374\" src=\"https://www.cavaha.com/wp-content/uploads/2023/03/khuech-tan-baseus-300x300.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2023/03/khuech-tan-baseus-300x300.jpg 300w, https://www.cavaha.com/wp-content/uploads/2023/03/khuech-tan-baseus-150x150.jpg 150w, https://www.cavaha.com/wp-content/uploads/2023/03/khuech-tan-baseus-768x768.jpg 768w, https://www.cavaha.com/wp-content/uploads/2023/03/khuech-tan-baseus-600x600.jpg 600w, https://www.cavaha.com/wp-content/uploads/2023/03/khuech-tan-baseus-100x100.jpg 100w, https://www.cavaha.com/wp-content/uploads/2023/03/khuech-tan-baseus.jpg 800w\" alt=\"\" width=\"600\" height=\"600\" loading=\"lazy\"></p></div></div></div>'),(186,85,0,106,'B Khuch Tn Tinh Du Nc Hoa  T Baseus'),(187,75,0,107,'<style>#html-body [data-pb-style=I71RLSP]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"I71RLSP\"><div data-content-type=\"text\" data-appearance=\"default\" data-element=\"main\"><p>Thi gian bm cng 1 lp ch khong trong 2 pht, bm rt khe,&nbsp; bm cng c tt c loi lp, k c lp xe ti, xe pickup, xe SUV, p sut bm ln  bm cho mi loi xe, khng cn ra ngoi tim bm lp na.</p>\r\n<p>Ph kin: thn bm + ti ng + dy bm + b ph kin, cam kt nh hnh nh . t cht lng ln hng u khng chy ua theo ngun hng gi r Chc cc bn a ra la chn sng sut.</p>\r\n<p><strong>My bm lp  t 2 xi lanh&nbsp;Air Compressor</strong>&nbsp;(25,5 x 9,5 x 20 cm) c thit k ph hp vi cc loi  t s dng in p 12V (xe di 16 ch ngi, xe ti c trng lng t 2 tn tr xung). Ngoi ra, sn phm cn dng cho xe my, xe p, bm bng, bm phao bi\\\\</p>\r\n<p><img class=\"aligncenter wp-image-19965\" src=\"https://www.cavaha.com/wp-content/uploads/2022/08/1-225x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2022/08/1-225x300.png 225w, https://www.cavaha.com/wp-content/uploads/2022/08/1-768x1024.png 768w, https://www.cavaha.com/wp-content/uploads/2022/08/1-1152x1536.png 1152w, https://www.cavaha.com/wp-content/uploads/2022/08/1-600x800.png 600w, https://www.cavaha.com/wp-content/uploads/2022/08/1.png 1200w\" alt=\"\" width=\"600\" height=\"800\"></p>\r\n<p><strong><em>Nhng lc nh vy bn s lm g ?</em></strong></p>\r\n<p><em><strong>y xe i tm ch sa =</strong>&gt;&nbsp;</em><strong>Bt kh thi</strong>&nbsp;<em>v</em>&nbsp;chic xe chng ta ang ni n l&nbsp;<strong> t</strong>&nbsp;ch u phi xe my</p>\r\n<p><em><strong>Gi cu h giao thng</strong>&nbsp;=&gt;&nbsp;</em><strong>Khng phi la chn ti</strong>&nbsp;<em>nhng</em>&nbsp;s tn kh nhiu thi gian ch i.</p>\r\n<p><em>Gi gara sa cha  t n ko xe v sa =&gt;&nbsp;</em>Tn rt nhiu thi gian c th b cht chm.</p>\r\n<p>Trong trng hp ny, nu trong cp xe ca bn c trang b mt chic my bm xe  t mini th mi chuyn s c x l mt cch d dng ch trong vi pht ng h.&nbsp;Bi mi khch hng s dng phng tin di chuyn l  t, chng ti lun khuyn mi ngi nn sm cho ring mnh mt chic&nbsp;<em><strong>my bm lp 2 xi lanh 44 Air Compressor&nbsp; chy bng 2 ng c cc khe</strong></em>&nbsp; c th ch ng x l trong cc trng hp xe b inh gm thng lp, hoc xe non hi, ht hi.</p>\r\n<p><img class=\"aligncenter wp-image-19966\" src=\"https://www.cavaha.com/wp-content/uploads/2022/08/2-225x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2022/08/2-225x300.png 225w, https://www.cavaha.com/wp-content/uploads/2022/08/2-768x1024.png 768w, https://www.cavaha.com/wp-content/uploads/2022/08/2-1152x1536.png 1152w, https://www.cavaha.com/wp-content/uploads/2022/08/2-600x800.png 600w, https://www.cavaha.com/wp-content/uploads/2022/08/2.png 1200w\" alt=\"\" width=\"600\" height=\"800\"></p>\r\n<p dir=\"auto\">My bm lp 2 xilanh bm ti a c 150 PSI nn vic bm chic xe bn ti mazda BT-50 vi p sut lp ch 3kg l iu qu bnh thng,&nbsp;c bit, trn vi bm cn c gn 1 ng h o p sut i km  kim tra p sut hi khi bm v c th tho ri, dy bm c kh nng co gin gip cho vic di chuyn bm hi gia cc bnh xe thun tin hn.&nbsp;Ngoi bm cc lp  t, Bm  t chuyn dng DC12V cn trang b thm 3 kim bm km theo, bn c th s dng bm  bm xe my, xe p, bm bng , bm xung, can</p>\r\n<p dir=\"auto\">+ Dng tt vi cc dng xe t 4-7 ch, k c xe bn ti &amp; xe ti nh.</p>\r\n<p dir=\"auto\">+ Bm siu nhanh, ch t 4-5 pht.</p>\r\n<p dir=\"auto\">+ Kh nng bm ti a 4 Kg.</p>\r\n<p dir=\"auto\">+ Tch hp n pin  s dng vo ban m..</p>\r\n<p><img class=\"aligncenter wp-image-19969\" src=\"https://www.cavaha.com/wp-content/uploads/2022/08/5-225x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2022/08/5-225x300.png 225w, https://www.cavaha.com/wp-content/uploads/2022/08/5-768x1024.png 768w, https://www.cavaha.com/wp-content/uploads/2022/08/5-1152x1536.png 1152w, https://www.cavaha.com/wp-content/uploads/2022/08/5-600x800.png 600w, https://www.cavaha.com/wp-content/uploads/2022/08/5.png 1200w\" alt=\"\" width=\"600\" height=\"800\"></p>\r\n<p dir=\"auto\">THNG S K THUT:</p>\r\n<p dir=\"auto\">+ S dng ngun in: 12  24V/10A.</p>\r\n<p dir=\"auto\">+ S Xy lanh: 2</p>\r\n<p dir=\"auto\">+ Dy ngun in di 4 mt + u cm tu 12V.</p>\r\n<p dir=\"auto\">+ Cht liu :Hp kim ,nha tng hp</p>\r\n<p dir=\"auto\">+ S dng ngun in: 12V/10A (c th s dng ngun in 220V nu bn c b i ngun)</p>\r\n<p dir=\"auto\">+ Mu sc: en bc</p>\r\n<p dir=\"auto\">+ Dng sn phm: Bm lp, bm hi, cu h  Xut x: Hng cng ty chun OEM  S Xylanh: 2</p>\r\n<p>+ Xut s: i Loan</p>\r\n<p>+ C ng h hin th gip ngi s dng theo di thi im bm  v kt thc ng</p>\r\n<h3><img class=\"aligncenter wp-image-19412\" src=\"https://www.cavaha.com/wp-content/uploads/2022/09/vn-11134207-7r98o-lnwrouluun3u5e-300x300.jpeg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.cavaha.com/wp-content/uploads/2022/09/vn-11134207-7r98o-lnwrouluun3u5e-300x300.jpeg 300w, https://www.cavaha.com/wp-content/uploads/2022/09/vn-11134207-7r98o-lnwrouluun3u5e-150x150.jpeg 150w, https://www.cavaha.com/wp-content/uploads/2022/09/vn-11134207-7r98o-lnwrouluun3u5e-768x768.jpeg 768w, https://www.cavaha.com/wp-content/uploads/2022/09/vn-11134207-7r98o-lnwrouluun3u5e-600x600.jpeg 600w, https://www.cavaha.com/wp-content/uploads/2022/09/vn-11134207-7r98o-lnwrouluun3u5e-100x100.jpeg 100w, https://www.cavaha.com/wp-content/uploads/2022/09/vn-11134207-7r98o-lnwrouluun3u5e.jpeg 1024w\" alt=\"Bm Lp  t 2 xi lanh\" width=\"600\" height=\"600\" loading=\"lazy\"></h3>\r\n<p>+ Trng lng khong 2,9kg</p>\r\n<p>+ C ng h hin th s cn hi</p>\r\n<p>+ Bm lin tc ti a: 15-20 pht.</p>\r\n<p>+ Lu lng bm kh: 55-72l/pht.</p>\r\n<p>+ p sut hi ti a: 150PSI ~ 10kg/cm</p>\r\n<p>+ Thi gian bm: ch khong 1 pht 30 giy/lp (tit kim rt nhiu thi gian ,tui th cao hn rt nhiu so vi bm 1 xi lanh)</p>\r\n<p>+ Dy ngun in di 4 mt vi u cm tu 12V</p>\r\n<p>+ ng bm di 80cm.<img class=\"aligncenter wp-image-19971\" src=\"https://www.cavaha.com/wp-content/uploads/2022/08/7-225x300.png\" sizes=\"(max-width: 600px) 100vw, 600px\